{{Государство|название=Олдраэль<br>Другие варианты:<br>''Свободно-Олдраэльская Социалистическая Республика''<br>''Свободно-Олдраэльская Социалистическая Автократия''|столица=''Старый Иерусалим'' (города де-юре не существует)|религия=[https://ru.wikipedia.org/wiki/Иудаизм иудаизм]|денежная_единица=[[Доллар]] / [[Шекель]]|форма_правления=[https://ru.wikipedia.org/wiki/Республика республика] / [https://ru.wikipedia.org/wiki/Автократия автократия]}}
: Возможно вы искали: ''[[Олдраэль (регион)]]''.
'''Олдраэль''' (также ''Свободно-Олдраэльская Социалистическая Республика'' при республиканстве или ''Свободно-Олдраэльская Социалистическая Автократия'' при автократии) — автономное территориальное образование в Олдраэле, которое не признали в [[Объединённая Пентархийская Социалистическая Конфедерация|ОПСФ]] (сейчас — ''ОПСК'') при его основании. При этом у образования есть своя "независимая" армия — [[Олдраэльская Социалистическая Армия|ОСА]].

{{Государство|название=Палестина|форма_правления=Автократия|премьер-министр=[[Severe_photo2]]|союзники=* [[Израиль|Израильский Рейх]]
* [[Германия|Германский Рейх]]}}
'''Палестина''' — [[Край (Ганзейское понятие)|крайнее]] государство, первое сохранённое упоминание которой датируется 24 августа 2021. В скором после своего основания Палестина вступила в [[Израиль|Израильский Рейх]]. Палестина основана сбежавшим президентом [[Мексика (CW)|Мексики]]. CW был крашнут из-за включения ядерного оружия Кипра правителем Палестины.
{{Страны}}

