Россия.png|Россия
</gallery>|название=* Россия
* Российская Социалистическая Республика|столица=[[Москва]]|крупнейшие_города=[[Москва]]|денежная_единица=[[Доллар]]|форма_правления=* Автократия}}
'''Россия''' (''в ОПСФ '''Российская Социалистическая Республика''''') — государство в [[Олдраэль|Олдраэле]] между [[Великобритания|Великобританией]] и [[Австрия|Австрией]] у берегов [[Центральный океан|Центрального океана]]. Ранее государство было в составе [[Великая Украина|Великой Украины]], но в ноябре 2021 было передано в состав [[Израиль|Израиля]], а после РСР стала отдельной республикой в [[Объединённая Пентархийская Социалистическая Федерация|Объединённой Пентархийской Социалистической Федерации]].
{{ОПСФ}}
