'''«Синяя Меза»''' — израильская корпорация заводов и научных центров на северо-западе Израиля.

{{Государство|image1=Словения.png|название=Словения|денежная_единица=[[Доллар]]|форма_правления=Автократия|премьер-министр=[[AntiDemo153]]|союзники=Страны [[ММЛС]]:
