'''Словения''' — непризнанное [[ООН]] государство, де-юре не имеющее территорий, самопровозгласившее свою независимость от [[Великая Украина|Великой Украины]].
{{ММЛС}}
{{Страны}}

{{Государство|image1=CCР.png|название=Словенская Социалистическая Республика ''(ССР)''|столица=[[Любляна]]|крупнейшие_города=[[Любляна]]|денежная_единица=[[Доллар]]|форма_правления=Автократия}}
