[[Категория:Регионы мира]]

{{Регион|название=Танкоград|страны=[[Империя Кипр|КСР]], [[Объединённая Пентархийская Социалистическая Федерация|ОПСФ]]|население=''отсутствует''}}
'''Танкоград''' — обширный регион в юго-восточной части мира, используемый как полигон [[ИВПС]]. Так же используется [[CMR]] для тестирования и хранения военной продукции корпорации. В связи с развитием военной промышленности полигон постоянно расширяется, поэтому главы КСР и CMR (де-факто один один и тот же человек) приняли решение о строительстве огромного ангара, в котором должны поместится абсолютно все модели военной техники [[ОПСФ]]. Пока что подробности об этом ангаре не известны, кроме того, что он будет высотой в 255 блоков (от бедрока не включительно до верхней границы мира).
[[Категория:Регионы мира]]

