{{Государство|название=* [[Файл:Кипр.png|25px|Чилленд]] Чилленд
* [[Файл:Кипр.png|25px|Чилленд]] Чиллендская Социалистическая Республика|столица=[[Чилленд (город)|Чилленд]]|крупнейшие_города=[[Чилленд (город)|Чилленд]]|денежная_единица=[[Доллар]]}}
'''Чилленд''' — островное государство в [[Центральный океан|Центральном океане]], состоящее в [[Объединённая Пентархийская Социалистическая Конфедерация|ОПСК]]. До объединения в ОПСК остров [[Чилленд (остров)|Чилленд]] принадлежал [[Кипр (WoP)|Империи Кипр]] как колония.

{{Остров|название=Чилленд|акватория=[[Центральный океан]]|страна=[[Файл:Кипр.png|25px|Чилленд]] [[Чилленд]], [[Файл:Флаг ОПСФ.png|25px|Объединённая Пентархийская Социалистическая Конфедерация]] [[Объединённая Пентархийская Социалистическая Конфедерация|ОПСК]]
[[Файл:Кипр.png|25px|Империя Кипр]] [[Империя Кипр]] (до 15 декабря 2021)}}
'''Чилленд''' — самый большой остров [[Центральный океан|Центральном океане]]. До объединения в [[Объединённая Пентархийская Социалистическая Конфедерация|ОПСФ]] принадлежал [[Империя Кипр|Империи Кипр]] как колония. Сейчас принадлежит одноимённой республике в ОПСК (ранее ОПСФ).

